import React, { Component } from "react";
import Table from "./common/table.component";

class Students extends React.Component {
    state = {
        headers: ['Roll Number', 'Name', 'CGPA'],
        movies: [
            {roll: 1, name: 'Mark', last_name: 'Otto', handle: '@mdo'},
            {roll: 2, name: 'Jacob', last_name: 'Thornton', handle: '@fat'},
            {roll: 3, name: 'Larry', last_name: 'the Bird', handle: '@twitter'},
        ]
    }
  render() {
    return (
      <>
        <Table />
      </>
    );
  }
}

export default Students;
